import React, { Component } from 'react'

export default class Search extends Component {
    state = {
        content: ''
    }

    handleChange = (e) =>{
        this.setState({
            content : e.target.value
        })

    }
    handleSubmit = (e) =>{
        e.preventDefault();
        this.setState({
            content:''
        })
    }
    render() {
        return (
            <div>
                <form className="col s12" onSubmit={this.handleSubmit}>
                    <div className="row">
                        <div className="input-field col s4 offset-s4">
                            <input id="city" type="text" class="validate" onChange={this.handleChange} value={this.state.content}></input>
                            <label for="city">Search For a City</label>
                        </div>
                    </div>
                </form>
            </div>
        )
    }
}
